{
  "十二届区委第66次常委会议（之一）": "《重庆市巴南区党内关怀办法（修订）》明确对符合条件的老党员实施敬老补助，具体标准为：党龄40-49年每月100元，50-54年每月120元，55年及以上每月150元；年满80周岁且党龄55年及以上的老党员享受上述补助。补助从党员党龄达到相关年限的次月起按月发放，标准随市级政策调整。"
}
